import {
    Box,
    Button,
    Container,
    Grid,
    Link,
    TextField,
    Typography,

} from '@material-ui/core';

const Forget = () => {
    return (
        <Container>

            <Box sx={{ mb: 3 }}>
                <Typography
                    color="textPrimary"
                    variant="h2"
                >
                    Sign in
                </Typography>
            </Box>

            <TextField
                // error={Boolean(touched.email && errors.email)}
                fullWidth
                // helperText={touched.email && errors.email}
                label="Email Address"
                margin="normal"
                name="email"
                onBlur={handleBlur}
                onChange={handleChange}
                type="email"
                value={values.email}
                variant="outlined"
            />

            <Box sx={{ py: 2 }}>
                <Button
                    color="primary"
                    disabled={isSubmitting}
                    fullWidth
                    size="large"
                    type="submit"
                    variant="contained"
                    onClick={moveTO}
                >
                    Sign in now
                </Button>
            </Box>
        </Container>
    );
}

export default Forget;
